social_posts.post_text:
😢 devastated yet incredibly proud.
Feel very honoured to keep #11 after it all… thank you @antmiddleton 
 @sasaustralia

Look how happy they are 🥹 gosh this warms my heart. 

Christmas hampers are such a beautiful gift of hope to give to those that are struggling. We will sometimes never know the impact a gift like this can give!! We so often focus on what we will receive, but the real joy comes from what you can give … to and that couldn’t have been more prevalent as we handed out hampers of hope to those in need throughout Dubai.

@kingdomcitydubai what you have done for these people is such a blessing, and it was an honour to be a very small part of it 🙌🏽
